export let app = 4;

console.log("is this executed?");

$(document).ready(function () {
  var $div = $("<div id='jquery-test'>yaho</div>");
  $div.appendTo("body");
  $("#jquery-test").text("wow, jquery success!");
  console.log("if underscore work, expect 5");
  console.log(_.max([5, 2, 1]));

  const Cat = Backbone.Model.extend({
    defaults: {
      a: 1,
      b: 2,
      c: 3,
    },

    initialize: function (number) {
      console.log(number);
    },
  });

  let cat = new Cat("backbone is working!");
});
